pragma solidity ^0.8.19;

import '@lib/openzeppelin-contracts/contracts/utils/math/SafeCast.sol';

import '../../../interfaces/stella-strategies/position-managers/IJoeV2_1HyperPositionManager.sol';
import '../../../interfaces/stella-strategies/position-managers/IBaseHyperPositionManager.sol';

import '../../../interfaces/stella-strategies/common/IConfig.sol';
import '../../../interfaces/stella-strategies/strategies/IBaseStrategy.sol';

import '../../../interfaces/stella-oracles/IBaseOracle.sol';

import '../../../interfaces/stella-libraries/traderjoe/v2_1/ILBPairV2_1.sol';

import '../common/LiquidationVault.sol';
import {BinHelper, PackedUint128Math} from './joev2-1/BinHelper.sol';

contract HyperStellaJoeV2_1Reader {
  using SafeCast for uint;
  using SafeCast for uint128;
  using PackedUint128Math for bytes32;
  using PackedUint128Math for uint128;
  using BinHelper for bytes32;
  struct AllData {
    uint debtRatioE18;
    uint positionUSDValueE36;
    uint collateralValueE36;
    uint borrowValueE36;
    int netPnLE36;
    address[] netTokenAddrs;
    int[] netTokenAmts;
    address[] underlyingTokens;
    uint128[] debts;
    uint[] sharingProfits;
    HyperPosition positionInfo;
    JoeV2_1ExtraPosInfo extraPosInfo;
    uint[] spotUnderlyingAmts;
  }

  address public immutable oracle;

  constructor(address _oracle) {
    oracle = _oracle;
  }

  function getPositionInfo(
    address _positionManager,
    address _user,
    uint _posId
  ) public view returns (HyperPosition memory) {
    return IBaseHyperPositionManager(_positionManager).getPositionInfo(_user, _posId);
  }

  //TODO: keep netTokens
  function getPnL(
    address _positionManager,
    address _user,
    uint _posId
  ) public view returns (address[] memory tokens, int[] memory netTokens, int netPnL) {
    HyperPosition memory pos = getPositionInfo(_positionManager, _user, _posId);

    if (
      pos.status == PositionStatus.CLOSED ||
      pos.status == PositionStatus.LIQUIDATED ||
      block.timestamp == pos.startTimestamp
    ) {
      return (new address[](0), new int[](0), 0);
    }

    tokens = IJoeV2_1HyperPositionManager(_positionManager).getUnderlyingTokens();
    uint[] memory positionUnderlyingTokens = getPositionSpotUnderlyingTokenAmts(
      _positionManager,
      _user,
      _posId
    );

    netTokens = new int[](2);

    (uint128[] memory inputs, ) = getInputsAndBorrows(pos.openTokenInfos);
    for (uint i; i < netTokens.length; ) {
      netTokens[i] = (positionUnderlyingTokens[i]).toInt256() - inputs[i].toInt256();
      unchecked {
        ++i;
      }
    }

    (netPnL, , , , ) = IBaseHyperPositionManager(_positionManager).calcProfitInfo(_user, _posId);
  }

  function getPositionSpotUnderlyingTokenAmts(
    address _positionManager,
    address _user,
    uint _posId
  ) public view returns (uint[] memory positionUnderlyingTokenAmts) {
    JoeV2_1ExtraPosInfo memory extraPosInfo = getDecodedExtraPosInfo(
      _positionManager,
      _user,
      _posId
    );
    address collToken = IBaseHyperPositionManager(_positionManager).collToken(); // gas saving
    positionUnderlyingTokenAmts = new uint[](2);

    for (uint i; i < extraPosInfo.binIds.length; ) {
      (uint128 binReserveX, uint128 binReserveY) = ILBPairV2_1(collToken).getBin(
        extraPosInfo.binIds[i].toUint24()
      );
      bytes32 binReserves = binReserveX.encode(binReserveY);
      uint supply = ILBPairV2_1(collToken).totalSupply(extraPosInfo.binIds[i]);
      bytes32 amountsOut = binReserves.getAmountOutOfBin(extraPosInfo.liquidities[i], supply);
      (uint128 amountX, uint128 amountY) = amountsOut.decode();
      positionUnderlyingTokenAmts[0] += amountX;
      positionUnderlyingTokenAmts[1] += amountY;
      unchecked {
        ++i;
      }
    }
  }

  function getProfitSharing(
    address _positionManager,
    address _user,
    uint _posId
  ) public view returns (address[] memory tokens, uint[] memory sharingProfits) {
    tokens = IBaseHyperPositionManager(_positionManager).getUnderlyingTokens();
    HyperPosition memory pos = getPositionInfo(_positionManager, _user, _posId);

    if (
      pos.status == PositionStatus.CLOSED ||
      pos.status == PositionStatus.LIQUIDATED ||
      block.timestamp == pos.startTimestamp
    ) {
      return (new address[](0), new uint[](0));
    }

    (, , , , sharingProfits) = IBaseHyperPositionManager(_positionManager).calcProfitInfo(
      _user,
      _posId
    );
  }

  function getPositionDebts(
    address _positionManager,
    address _user,
    uint _posId
  ) public view returns (address[] memory tokens, uint128[] memory debts) {
    HyperPosition memory pos = getPositionInfo(_positionManager, _user, _posId);

    if (pos.status == PositionStatus.CLOSED || pos.status == PositionStatus.LIQUIDATED) {
      return (new address[](0), new uint128[](0));
    }

    (tokens, debts) = IBaseHyperPositionManager(_positionManager).getPositionDebts(_user, _posId);
  }

  function getPositionDebtRatioE18(
    address _positionManager,
    address _user,
    uint _posId
  ) public view returns (uint debtRatioE18) {
    debtRatioE18 = IBaseHyperPositionManager(_positionManager).getPositionDebtRatioE18(
      _user,
      _posId
    );
  }

  function getBorrowValueE36(
    address _positionManager,
    address _user,
    uint _posId
  ) public view returns (uint borrowValueE36) {
    (address[] memory tokens, uint128[] memory debts) = getPositionDebts(
      _positionManager,
      _user,
      _posId
    );

    uint[] memory tokenPriceE36s = IBaseOracle(oracle).getUSDPriceE36s(tokens);

    for (uint i; i < tokens.length; ) {
      if (debts[i] > 0) {
        borrowValueE36 += debts[i] * tokenPriceE36s[i];
      }
      unchecked {
        ++i;
      }
    }
  }

  function getCollateralValueE36(
    address _positionManager,
    address _user,
    uint _posId
  ) public view returns (uint collateralValueE36) {
    HyperPosition memory pos = IBaseHyperPositionManager(_positionManager).getPositionInfo(
      _user,
      _posId
    );

    // lp and fee value
    collateralValueE36 = IBaseHyperPositionManager(_positionManager).getPositionUSDValueE36(
      _user,
      _posId
    );

    address[] memory extraCollTokens = IBaseHyperPositionManager(_positionManager)
      .getUnderlyingTokens();

    uint128[] memory extraCollAmts = pos.extraCollAmts; // gas saving

    for (uint i; i < extraCollAmts.length; ) {
      collateralValueE36 +=
        extraCollAmts[i] *
        IBaseOracle(oracle).getUSDPriceE36(extraCollTokens[i]);
      unchecked {
        ++i;
      }
    }
  }

  function getPositionUSDValueE36(
    address _positionManager,
    address _user,
    uint _posId
  ) public view returns (uint positionUSDValueE36) {
    HyperPosition memory pos = getPositionInfo(_positionManager, _user, _posId);

    if (pos.status == PositionStatus.CLOSED || pos.status == PositionStatus.LIQUIDATED) {
      return 0;
    }

    positionUSDValueE36 = IBaseHyperPositionManager(_positionManager).getPositionUSDValueE36(
      _user,
      _posId
    );
  }

  function claimableAmount(
    address _strategy,
    address _user,
    uint _posId,
    address _token
  ) public view returns (uint) {
    address config = IBaseStrategy(_strategy).config();
    address liquidationVault = IConfig(config).liquidationVault();
    return LiquidationVault(liquidationVault).claimableAmts(_token, _strategy, _user, _posId);
  }

  function getDecodedExtraPosInfo(
    address _positionManager,
    address _user,
    uint _posId
  ) public view returns (JoeV2_1ExtraPosInfo memory) {
    HyperPosition memory pos = IBaseHyperPositionManager(_positionManager).getPositionInfo(
      _user,
      _posId
    );

    return _getDecodedExtraPosInfo(pos.extraPosInfo);
  }

  function getAllData(
    address _positionManager,
    address _user,
    uint _posId
  ) external view returns (AllData memory allData) {
    allData.debtRatioE18 = getPositionDebtRatioE18(_positionManager, _user, _posId);
    allData.positionUSDValueE36 = getPositionUSDValueE36(_positionManager, _user, _posId);
    allData.collateralValueE36 = getCollateralValueE36(_positionManager, _user, _posId);
    allData.borrowValueE36 = getBorrowValueE36(_positionManager, _user, _posId);
    (allData.netTokenAddrs, allData.netTokenAmts, allData.netPnLE36) = getPnL(
      _positionManager,
      _user,
      _posId
    );
    allData.underlyingTokens = IBaseHyperPositionManager(_positionManager).getUnderlyingTokens();
    (, allData.debts) = getPositionDebts(_positionManager, _user, _posId);
    (, allData.sharingProfits) = getProfitSharing(_positionManager, _user, _posId);
    allData.positionInfo = getPositionInfo(_positionManager, _user, _posId);
    allData.extraPosInfo = getDecodedExtraPosInfo(_positionManager, _user, _posId);
    allData.spotUnderlyingAmts = getPositionSpotUnderlyingTokenAmts(
      _positionManager,
      _user,
      _posId
    );
  }

  // ===================== internal pure =====================
  function _getDecodedExtraPosInfo(
    bytes memory _data
  ) internal pure returns (JoeV2_1ExtraPosInfo memory) {
    return abi.decode(_data, (JoeV2_1ExtraPosInfo));
  }

  // ===================== public pure =====================
  function getInputsAndBorrows(
    OpenTokenInfo[] memory _openTokenInfos
  ) public pure returns (uint128[] memory inputs, uint128[] memory borrows) {
    inputs = new uint128[](_openTokenInfos.length);
    borrows = new uint128[](_openTokenInfos.length);

    // store input amounts & borrow amounts into inputs arr and borrows arr
    for (uint i; i < _openTokenInfos.length; ) {
      inputs[i] = _openTokenInfos[i].inputAmt;
      borrows[i] = _openTokenInfos[i].borrowAmt;
      unchecked {
        ++i;
      }
    }
  }
}
